import React from 'react';
import {
  Box,
  Container,
  Typography,
  makeStyles
} from '@material-ui/core';
import Page from 'src/components/Page';

const useStyles = makeStyles((theme) => ({
  root: {
    backgroundColor: theme.palette.background.dark,
    height: '100%',
    paddingBottom: theme.spacing(3),
    paddingTop: theme.spacing(3)
  },
  image: {
    marginTop: 50,
    display: 'inline-block',
    maxWidth: '100%',
    width: 560
  }
}));

const HomeView = () => {
  const classes = useStyles();

  return (
    <Page
      className={classes.root}
      title="home"
    >
      <Box
        display="flex"
        flexDirection="column"
        height="100%"
        justifyContent="center"
      >
        <Container maxWidth="md">
          <Typography
            align="center"
            color="textPrimary"
            variant="h1"
          >
            Welcome to our Healthcare Dashboard!
          </Typography>
          <Typography
            align="center"
            color="textPrimary"
            variant="subtitle2"
          >
            The visualizations on this website show some relationships we found interesting
            with the Medical Information Mart for Intensive Care III. MIMIC-III is a large,
            freely-available database comprising deidentified health-related data associated
            with over forty thousand patients who stayed in critical care units of the Beth
            Israel Deaconess Medical Center between 2001 and 2012. 
          </Typography>
          <Box textAlign="center">
          </Box>
        </Container>
      </Box>
    </Page>
  );
};

export default HomeView;
